        const addScript = (url, onload) => {
            const script = document.createElement('script');
            script.src = url;
            script.onload = onload;
            document.head.appendChild(script);
        };

        const addLink = (rel, href) => {
            const link = document.createElement('link');
            link.rel = rel;
            link.href = href;
            document.head.appendChild(link);
        };

        const loadGPXPlugin = () => addScript(gpxPluginUrl, initializeMaps);

        const createMapForCollectionItem = (gpxFile, mapContainer, callback) => {
            const runItem = mapContainer.closest('.run-item');

            if (mapContainer._leaflet_id) return;

            const map = L.map(mapContainer, { zoomControl: false, dragging: false, zoomSnap: 0 }).setView([0, 0], 12);

            L.tileLayer('', { attribution: '' }).addTo(map);
            map.scrollWheelZoom.disable();

            fetch(gpxFile)
                .then(response => response.text())
                .then(gpxData => {
                    const gpxLayer = new L.GPX(gpxData, {
                        async: true,
                        polyline_options: { color: '#EBEBEB', weight: 4 },
                        marker_options: { startIconUrl: null, endIconUrl: null, shadowUrl: null },
                    });

                    gpxLayer.on('loaded', () => {
                        map.fitBounds(gpxLayer.getBounds(), { animate: false, padding: [5, 5] });

                        const setElementContent = (selector, content) => {
                            const element = runItem.querySelector(`.text-holder ${selector}`);
                            if (element) element.textContent = content;
                        };

                        const distance = gpxLayer.get_distance_imp().toFixed(2) + ' mi';
                        const date = formatDate(gpxLayer.get_start_time());
                        const elevation = gpxLayer.get_elevation_gain_imp().toFixed(0) + ' ft';
                        const avgpace = formatPace(gpxLayer.get_moving_pace_imp());
                        const totaltime = formatDuration(gpxLayer.get_total_time());

                        setElementContent('#distance', distance);
                        setElementContent('#date', date);
                        setElementContent('#elevation', elevation);
                        setElementContent('#avgpace', avgpace);
                        setElementContent('#totaltime', totaltime);

                        window.addEventListener('resize', () => {
                            map.invalidateSize();
                            map.fitBounds(gpxLayer.getBounds(), { animate: false, padding: [5, 5] });
                        });

                        callback();
                    });

                    gpxLayer.addTo(map);

                    runItem.addEventListener('mouseenter', () => gpxLayer.setStyle({ color: '#1100c9' }));
                    runItem.addEventListener('mouseleave', () => gpxLayer.setStyle({ color: '#EBEBEB' }));
                    runItem.addEventListener('mouseenter', () => runItem.classList.add('hovered'));
                    runItem.addEventListener('mouseleave', () => runItem.classList.remove('hovered'));
                })
                .catch(error => console.error('Error fetching GPX file:', error));
        };

        const initializeMaps = () => {
            const parentElement = document.querySelector('.collection-list');

            // Iterate through the GPX files array
            gpxFilesArray.forEach((gpxFile, index) => {
                // Clone the template .run-item
                const runItemTemplate = document.querySelector('.run-item');
                const runItemClone = runItemTemplate.cloneNode(true);

                // Update the data attributes and add the cloned .run-item to the parent element
                runItemClone.querySelector('.map-container').dataset.gpxUrl = gpxFile;
                runItemClone.querySelector('.map-container').dataset.date = '';  // You can set the date if needed
                parentElement.appendChild(runItemClone);

                // Initialize the map for the current .run-item
                const mapContainer = runItemClone.querySelector('.map-container');
                createMapForCollectionItem(gpxFile, mapContainer, () => {
                    // Callback function after map initialization
                });
            });
        };

        const parseDate = dateString => {
            const [month, day, year] = dateString.split('/').map(Number);
            return new Date(year + 2000, month - 1, day);
        };

        const formatDuration = durationInMs => {
            const seconds = Math.floor(durationInMs / 1000);
            const hours = Math.floor(seconds / 3600);
            const minutes = Math.floor((seconds % 3600) / 60);
            const remainingSeconds = seconds % 60;
            const hoursText = hours > 0 ? hours.toString().padStart(2, '0') + ':' : '';
            return `${hoursText}${minutes.toString().padStart(2, '0')}:${remainingSeconds.toString().padStart(2, '0')}`;
        };

        const formatPace = paceInMs => {
            const minutesPerMile = paceInMs / 60000;
            const minutes = Math.floor(minutesPerMile);
            const seconds = Math.round((minutesPerMile - minutes) * 60);
            return `${minutes}'${seconds.toString().padStart(2, '0')}"`;
        };

        const formatDate = dateString => {
            const date = new Date(dateString);
            const month = (date.getMonth() + 1).toString().padStart(2, '0');
            const day = date.getDate().toString().padStart(2, '0');
            const year = date.getFullYear().toString().slice(-2);
            return `${month}/${day}/${year}`;
        };

        addLink('stylesheet', cssUrl);
        addScript(jsUrl, loadGPXPlugin);
